import React from 'react';
import { TextField, button, Typography } from '@material-ui/core';

import useStyles from './styles';

const Form = () => {
    const classes  = useStyles();
    
    return (
        <paper className={classes.paper}>
        <form autoComplete=''></form>

        </paper>
    );
}

export default Form;
